    <div>
        <Grid container direction="column" spacing={1} justifyContent="center" alignItems="center" style={{marginTop:100}}>
            <h1>hi</h1>
            <img src="./landing.jpg" />
        </Grid>
    </div>
  );
}

export default Landing;
